def extract_info(data_string, start, finish):
    lens = []
    
    # Regular expressions for extracting the desired data
    len_pattern = re.compile(r'Len: (\d+\.\d{9})$')

    # Split the data string into lines and process each line
    for line in data_string.split("\n"):
        # Extract queue size
        match = len_pattern.search(line)
        if match:
          lens.append(match.group(1))

    lens = [float(i) for i in lens]
    utilization = sum(lens)/(finish-start)

    return utilization


# Copied from eval2ef.py
def stats(text):
  pattern = re.compile(r"Sent: (\d+\.\d+) Recv: (\d+\.\d+)")
      
  matches = pattern.findall(text)

  resp_time = [float(recv) - float(sent) for sent, recv in matches]

  avg_resp = sum(resp_time) / len(resp_time)

  return avg_resp

